		Dml("Perform SQL-like analysis of Heap objects enabling comparison, <link cmd=\"!whelp expression\">expression</link> evaluation and indexed filtering.\n");
		Dml("It requires that you run !<link cmd=\"!whelp windex\">windex</link> first to index heap if you are using any fielter option (like -type)\n");
		Dml("\n");
