		Dml(" |-fieldtype &lt;partial-type-name-list&gt;|-fieldname &lt;partial-field-name&gt; \n");
		Dml("  [where (&lt;boolean-expression&lt;)]\n");
		Dml("  select &lt;expression-list&gt;\n");
		Dml("\n");
		Dml("<b>Where:</b>\n");
		Dml("	Switches:\n");
		Dml("	---------\n");
		Dml("	<b>-nofield</b> Do not show the field name in the result. Optional\n");
		Dml("	<b>-nospace</b> Do not print line feed or spaces between fields. Optional\n");
		Dml("	\n");
		Dml("	Filters (choose just one of the following):\n");
		Dml("	-------------------------------------------\n");
		Dml("	<b>-mt &lt;address-list&gt;</b> List of Method Tables to include (eg. -mt 7012ab8,70ac080)\n");
		Dml("	<b>-withpointer</b> Lists all types which include pointer (objects) fields\n");
		Dml("	<b>-obj &lt;address&gt;</b> Object address (single object)\n");
		Dml("	<b>-array &lt;address&gt;</b> Array address\n");
		Dml("	<b>-type &lt;partial-type-name-list&gt;</b> List of types to include. Wildcards accepted \n");
		Dml("		(eg. -type *HttRequest,system.servicemodel.*)\n");
		Dml("	<b>-implememt &lt;partial-type-name-list&gt;</b> List of parent types that the type must\n");
		Dml("		implement (eg. -implement *.Exception,*.Array). It does not check interfaces implemented\n");
		Dml("	<b>-fieldtype &lt;partial-type-name-list&gt;</b> List of field types that the type must\n");
		Dml("		contain (eg. -fieldtype *.String,*.object)\n");
		Dml("	<b>-fieldname &lt;partial-field-name&gt;</b> List of field names that the type must\n");
		Dml("		contain (eg. -fieldname *request,_wr)\n");
		Dml("\n");
		Dml("	<b>where (&lt;boolean-expression&lt;)</b> Filters the output based on the boolean <link cmd=\"!whelp expression\">expression</link>. Optional\n");
		Dml("	<b>select &lt;expression-list&gt;</b> List of expressions which can be fields (and inner fields), expressions (eg. field1+0n10),\n");
		Dml("			and functions (eg. $addr()+$fieldoffset(_length))\n");
		Dml("\n");
		Dml("<b>Differences from !<link cmd=\"!whelp wdo\">wdo</link></b>\n");
		Dml("-------------------------\n");
		Dml("	- It can format the output completely\n");
		Dml("	- There is no header\n");
		Dml("	- You have to know the field names\n");
		Dml("	- Fields can be nested as in C#. Example: !wsfrom -obj 0x0ab98848 select myUri.m_String\n");
		Dml("\n");
		Dml("<b>Differences from !<link cmd=\"!whelp wselect\">wselect</link></b>\n");
