		Dml("	000007fee15ddd90 Microsoft.Web.Administration.ConfigurationAttribute (1)\n");
		Dml("	000007fee15dd948 Microsoft.Web.Administration.ConfigurationElement (17)\n");
		Dml("	000007fee15dde18 Microsoft.Web.Administration.ConfigurationElementCollection (5)\n");
