		Dml("	(...)\n");
		Dml("\n");
		Dml("	Heap contains 55014 Objects in 1522 types\n");
		Dml("\n");
		Dml("<i>Saves index to disk (very useful for reuse in SharePoint dumps)</i>\n");
		Dml("---------------------------------------------------------------\n");
		Dml("	0:000&gt; !windex -save c:\\temp\\temp.idx\n");
		Dml("	Index is up to date\n");
		Dml("	(...)\n");
		Dml("	Hash: 5be3fd81\n");
		Dml("	Index saved succesfully on c:\\temp\\temp.idx\n");
		Dml(" \n");
		Dml("<i>Load a previously saved index file (life safer for revisiting a large dump file)</i>\n");
