		Dml("All functions start with '$' sign.\n");
		Dml("Functions are what enable the data mining operations on the heap.\n");
		Dml("Below is the list by group.\n");
		Dml("\n");
		Dml("<b>Syntax</b>:\n");
		Dml("------------\n");
		Dml("$&lt;function-name&gt;([&lt;expr1[,...,[exprN]]])\n");
		Dml("\n");
		Dml("<b>Where:</b>\n");
		Dml("------------\n");
		Dml("<b>&lt;exprN&gt;</b> - it is an expression that can be:\n");
