		Dml("	- A string literal or <link cmd=\"!whelp expression\">expression</link>\n");
		Dml("	- A boolean <link cmd=\"!whelp expression\">expression</link> or literal (0=false, not 0=true)\n");
		Dml("	- A field with or without inner fields separated by '.'\n");
		Dml("	- A function or function expression\n");
		Dml("\n");
		Dml("<b>General Purpose:</b>\n");
		Dml("----------------\n");
