		Dml("<b>$int(&lt;expr&gt;)</b> - Return the integer part of a float number expression\n");
		Dml("<b>$max(&lt;expr1&gt;, &lt;expr2&gt;)</b> - Return the bigger value of two expressions\n");
		Dml("<b>$if(&lt;cond&gt;, &lt;expr1&gt;, &lt;expr2&gt;)</b> - If cond is true returns expr1 or expr2 if false\n");
